import { createApp } from 'vue'
import App from './App.vue'
import LoginView from './pages/LoginView.vue'

createApp(App)
.use(VueRouter.createRouter({
    history: VueRouter.createWebHistory(process.env.BASE_URL),
    route:[{
        path:'/login',
        component: LoginView,
    }]
}))
.mount('#app')
